import InputLabel from '@material-ui/core/InputLabel';
import MenuItem from '@material-ui/core/MenuItem';
import FormControl from '@material-ui/core/FormControl';
import Select from '@material-ui/core/Select';
import Box from '@material-ui/core/Box';

export default function DateSelector() {

    const arrayOfYear = [2021, 2020, 2019]
    const arrayOfMonth = [
    "Janeiro",
    "Fevereiro",
    "Março",
    "Abril",
    "Maio",
    "Junho",
    "Julho",
    "Agosto",
    "Setembro",
    "Outubro",
    "Novembro",
    "Dezembro"
]

    return (
        <Box>
            <FormControl variant="filled">
                <InputLabel id="combo-age">Ano</InputLabel>
                <Select labelId="combo-age" id="select-age" value='teste'>
                    {
                        arrayOfYear.map(year => 
                            <MenuItem key={year} value={year}>{year}</MenuItem>)
                    }
                </Select>
            </FormControl>

            <FormControl>
                <InputLabel id="combo-month">Mês</InputLabel>
                <Select labelId="combo-month" id="select-day" value='teste'>
                    {
                        arrayOfMonth.map(month => 
                            <MenuItem key={month} value={month}>{month}</MenuItem>)
                    }
                </Select>
            </FormControl>
        </Box>
    )
}
